import { api } from './api'

console.log(111,api)

async function userCreate(userInfo) {
  return await api.post('/member/create', userInfo)
}

async function userLogin(userInfo) {
  return await api.post('/member/login', userInfo)
}

export { userCreate, userLogin } 


